DROP TABLE IF EXISTS `prefix_monit_school_pupil_card`;
CREATE TABLE `prefix_monit_school_pupil_card` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `userid` INTEGER UNSIGNED NOT NULL default 0,
  `schoolid` INTEGER UNSIGNED NOT NULL default 0,
  `classid` INTEGER UNSIGNED NOT NULL default 0,
  `typedocuments` tinyint NOT NULL default 1,
  `serial` varchar(8) NOT NULL default '-',
  `number` integer NOT NULL default 0,
  `who_hands` varchar(100) NOT NULL default '',
  `when_hands` date default NULL,
  `pswtxt` varchar(8) NOT NULL default '-',
  `listegeids` VARCHAR(255) NOT NULL DEFAULT '0',
  PRIMARY KEY  (`id`),
 	INDEX userid(`userid`),
  INDEX schoolid(`schoolid`),
  INDEX classid(`classid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `prefix_monit_school_class`;
CREATE TABLE `prefix_monit_school_class` (
  `id` int(10) unsigned NOT NULL auto_increment,
	`curriculumid` INTEGER UNSIGNED NOT NULL default 0,
  `schoolid` INTEGER UNSIGNED NOT NULL default 0,
  `yearid` INTEGER UNSIGNED default NULL default 2,
  `name` varchar(10) NOT NULL,
	`description` varchar(254) NULL,
	`timecreated` int(10) unsigned default NULL,
	`timeadded` int(10) unsigned default NULL,
  PRIMARY KEY  (`id`),
  INDEX schoolid(`schoolid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `prefix_monit_school_discipline_ege`;
CREATE TABLE `prefix_monit_school_discipline_ege` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `yearid`INTEGER UNSIGNED NOT NULL,
  `name` varchar(30) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `prefix_monit_school_ege_marks`;
CREATE TABLE `prefix_monit_school_ege_marks` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `egeid` INTEGER UNSIGNED NOT NULL,
  `userid` INTEGER UNSIGNED NOT NULL,
  `mark` smallint unsigned NOT NULL,
  `datecreate` date default NULL,
  PRIMARY KEY  (`id`),
  INDEX egeid(`egeid`),
  INDEX userid(`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


